import React,{Component} from 'react';
import './Mysearchstyle.css'
class Mysearch extends Component{
    constructor(props){
        super(props);

        this.state={
            value: null
        }
    }

    render(){
        return(
            <div className="mysearch">
                <div>
                    <input value={this.state.value} onChange={this.changeEvent}></input>
                </div>
            </div>
        )
    }


    changeEvent=(e)=>{
        this.setState({
            value: e.target.value
        })
    }
}

export default Mysearch;
